INSERT INTO public.extras (extraid, extracategoryid, name, description, price, image, createdat) VALUES ('d5d6f46a-f320-4713-aad1-01624e19345a', '621e3ce0-843e-47c3-981a-e018792f1ba6', 'Vệ sinh da thuộc', 'Chỉ sử dụng xi Saphir cao cấp nhập khẩu từ Pháp (thương hiệu tốt nhất dành cho các dòng giày da). Đã bao gồm một lớp xi dưỡng mỏng bảo vệ giày da toàn diện, làm mềm bề mặt, cải thiện nếp nhăn.', 70000, 'https://laundryservicebucket.s3.ca-east-006.backblazeb2.com/extras/5b2ff9d6-a69c-42b5-becf-fc18cfed8650.jpg', '2025-03-16 06:57:24.905961+00');
INSERT INTO public.extras (extraid, extracategoryid, name, description, price, image, createdat) VALUES ('0b7f1ed2-c830-4177-a4c6-06ca07fb417b', '621e3ce0-843e-47c3-981a-e018792f1ba6', 'Vệ sinh da lộn', 'Vệ sinh khô chất liệu da lộn, nubuck với dung dịch vệ sinh chuyên dụng cao cấp. Hạn chế đến 99% việc khô cứng da, xù lông sau khi vệ sinh.', 70000, 'https://laundryservicebucket.s3.ca-east-006.backblazeb2.com/extras/45e0c122-d7b5-4842-9e47-7e07c66fe927.jpg', '2025-03-16 06:59:31.479955+00');
